import java.util.Arrays;
import java.util.List;

import org.hamcrest.CoreMatchers;
import org.junit.Assert;
import org.junit.Test;

public class FindAllAnagramsInStringTest {
	@Test
	public void test() {
		FindAllAnagramsInString f = new FindAllAnagramsInString();
		List<Integer> result = f.findAnagrams("cbaebabacd", "abc");
		Assert.assertThat(result, CoreMatchers.equalTo(Arrays.asList(0, 6)));

		result = f.findAnagrams("aaaaabaaaaa", "aaaaa");
		Assert.assertThat(result, CoreMatchers.equalTo(Arrays.asList(0, 6)));

		result = f.findAnagrams(

				"",

				"");
		Assert.assertThat(result, CoreMatchers.equalTo(Arrays.asList(0, 10001)));
	}

}